import React, {Component} from 'react';
import {FiPhone} from 'react-icons/fi';


class BusinessList extends Component{

    render(){
        const businesses = this.props.businesses;
        const displayBusiness = businesses.map(item => {
            return (
                <div  className="row item-list" key={item.businessID}>
                    <div className="col-sm-5">
                        <img src={item.businessImage} className="image rounded float-center"  alt="..." />

                    </div>
                    <div className="col-sm-7">

                        <h3>{item.businessName}</h3>
                        <p>Rating: {item.businessRating}({item.businessReviewCount})</p>
                        <p><FiPhone />  {item.businessPhone}</p>
                        <p><FiHome/> {item.businessAddress}</p>
                    </div>

                </div>
            )
        })

        return(
            <div className="row justify-content-center">
                {displayBusiness}
                {/* <div className="col-sm-12">{displayBusiness}</div> */}
            </div>
        );
    }
}

export default BusinessList;
